import styled from 'styled-components';

const FONT_SIZE = {
  mainHeader:"50px"
}

const fontColor = {
  basegray: '#707070',
  black: '#000000',
};

const Text = styled.span`
color:${fontColor.basegray};

`;
export default Text;
